import React from 'react'
import VideoPlayer from "react-video-js-player";
import EnteskVidio from '../../video/Entesk.MOV';
import sectionImg from './metaImg/sectionOnebg.jpeg'
import {useSpring,animated} from 'react-spring';


const SectionOne = () => {

  const container = useSpring({
		to: [{height: "400px" }],

		from: {height: "200px"  },
    config: {
      duration: 1500,
      delay:20
    }
	})

  const Title = useSpring({
		to: [{top: "100px" }],
		from: {top: "-300px"  },
    config: {
      duration: 1500
    }
	})

  return (
    <article className='metatesk-info section-one'>
      {/* <div className='png' ></div> */}
      <animated.div style={container} className="container">
        <div className="container-fluid">
          <div className="row">
            <div className="col-md-6 ">
              <animated.div className='metatesk-text' >
                <p>A virtual venue which provides educators and  learners with equipped classrooms. </p>  
              </animated.div>
            </div>
            <div className="col-md-6 ">
              <animated.div className='metatesk-img'>
                <img src={sectionImg} alt="metatesk" />
              </animated.div>
            </div>

          </div>
        </div>
      </animated.div>
    </article>
  )
}

export default SectionOne
